import MainPic from '../../images/mainpicture.png' //src={MainPic}
import './Services.css'

function Services() {
  return (
      <section className="promo">
        <h2 className="promo__title">Услуги</h2>
        <ul className="promo__wrapper">
            <li className="promo__container">
                <img className="promo__container-pic"></img>
                <h3 className="promo__container-title"></h3>
                <p className="promo__container-text"></p>
                <button className="promo__container-btn"></button>
            </li>
        </ul>

      </section>
  );
}

export default Services;
